import { request } from '@/utils/request';
export const getAll = async (all, page, size, callback) => {
  return await request('get', `/api/extensions/queue/get_all`, {
    all,
    offset: (page - 1) * size,
    number: size
  }, callback);
};
export const create = async (max, password, description, callback) => {
  return await request('get', `/api/extensions/queue/create`, {
    max,
    password,
    description
  }, callback);
};
